            "\u0421\u0435\u0433\u043E\u0434\u043D\u044F \u044D\u0442\u0430 \u043F\u0440\u043E\u0446\u0435\u0434\u0443\u0440\u0430 \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u043E \u0432\u0438\u0434\u043E\u0438\u0437\u043C\u0435\u043D\u0438\u043B\u0430\u0441\u044C,\n      \u0431\u0440\u0438\u0442\u044C\u0435 \u043E\u043F\u0430\u0441\u043D\u043E\u0439 \u0431\u0440\u0438\u0442\u0432\u043E\u0439 \u043F\u0440\u0435\u0432\u0440\u0430\u0442\u0438\u043B\u043E\u0441\u044C \u0432 \u044D\u043B\u0438\u0442\u043D\u0443\u044E, \u043C\u043E\u0434\u043D\u0443\u044E \u0438 \u0434\u043E\u0440\u043E\u0433\u043E\u0441\u0442\u043E\u044F\u0449\u0443\u044E \u0443\u0441\u043B\u0443\u0433\u0443.\n      \u041F\u0440\u0438 \u044D\u0442\u043E\u043C \u0446\u0435\u043B\u044C \u2013 \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u0441\u0434\u0435\u043B\u0430\u0442\u044C \u043A\u043E\u0436\u0443 \u043A\u043B\u0438\u0435\u043D\u0442\u0430 \u0431\u0435\u0437\u0443\u043F\u0440\u0435\u0447\u043D\u043E \u0433\u043B\u0430\u0434\u043A\u043E\u0439,\n      \u043C\u044F\u0433\u043A\u043E\u0439 \u0438 \u0431\u043B\u0430\u0433\u043E\u0443\u0445\u0430\u044E\u0449\u0435\u0439. \u041C\u0443\u0436\u0447\u0438\u043D\u0430 \u0434\u043E\u043B\u0436\u0435\u043D \u043C\u0430\u043A\u0441\u0438\u043C\u0430\u043B\u044C\u043D\u043E \u0440\u0430\u0441\u0441\u043B\u0430\u0431\u0438\u0442\u044C\u0441\u044F \u0432\n      \u043F\u0440\u043E\u0446\u0435\u0441\u0441\u0435 \u0431\u0440\u0438\u0442\u044C\u044F, \u043E\u0442\u0432\u043B\u0435\u0447\u044C\u0441\u044F \u043E\u0442 \u0445\u043B\u043E\u043F\u043E\u0442 \u0438 \u0441\u0443\u0435\u0442\u044B, \u0438\u0437\u0431\u0430\u0432\u0438\u0442\u044C\u0441\u044F \u043E\u0442 \u0441\u0442\u0440\u0435\u0441\u0441\u0430\u2026\n       \u0441\u043B\u043E\u0432\u043E\u043C, \u043F\u043E\u043A\u0438\u043D\u0443\u0442\u044C \u0441\u0430\u043B\u043E\u043D \u043D\u043E\u0432\u044B\u043C \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u043E\u043C, \u0433\u043E\u0442\u043E\u0432\u044B\u043C \u043A \u043D\u043E\u0432\u044B\u043C \u0441\u0440\u0430\u0436\u0435\u043D\u0438\u044F\u043C \u0438 \u043F\u0440\u0438\u043A\u043B\u044E\u0447\u0435\u043D\u0438\u044F\u043C.\n       \u041A\u0430\u043A\u0438\u043C\u0438 \u043C\u0435\u0442\u043E\u0434\u0430\u043C\u0438 \u043F\u0440\u0435\u0434\u043B\u0430\u0433\u0430\u0435\u0442\u0441\u044F \u044D\u0442\u043E\u0433\u043E \u0434\u043E\u0441\u0442\u0438\u0447\u044C? "
